import React from 'react';
import {Link} from 'react-router-dom';

function Navs() {
    return (
        <div>
            <ul>
                <li>
                    <Link to="/contacts">Go to contactspage</Link>
                </li>
            </ul>
            
        </div>
    );
};

export default Navs
